/*global THREE*/

var camera, material, geometry, mesh, scene, image;
var camera1, camera2, camera3, renderer;

var clock = new THREE.Clock();
var delta;

var moveLatitudePos = false,
    moveLatitudeNeg = false,
    moveLongitudePos = false,
    moveLongitudeNeg = false;

var movement;

var ratio = 1.25, 
    scale = 0.010, 
    scale_width, 
    scale_height, 
    last_width, 
    last_height;

var planetRadius = 50, _longitude, _colatitude;
var rocketObj, colisionSphere, rocketBody, rocketNose, windowRocket, thrusters = [];
const objects = [];

var quadrant1 = [], quadrant2 = [], quadrant3 = [], quadrant4 = [];
var toDelete = [];

var signal = 1;

function translateRocket(radius, colatitude, longitude) {
    'use strict';
    var oldPosition = [radius * Math.cos(_longitude) * Math.sin(_colatitude), radius * Math.sin(_longitude) * Math.sin(_colatitude), radius * Math.cos(_colatitude)];

    _colatitude += colatitude*signal; // theta, from 0 to pi
    _longitude += longitude; // phi, from 0 to 2pi

    if (_colatitude < 0) {
        _colatitude = -_colatitude;
        _longitude = _longitude - Math.PI;
        signal = signal*(-1);
    }
    if (_colatitude > Math.PI) {
        _colatitude = Math.PI - (_colatitude - Math.PI);
        _longitude = _longitude - Math.PI;
        signal = signal*(-1);
    }
    if (_longitude < 0) {
        _longitude = Math.PI * 2 + _longitude;
    }
    if (_longitude > Math.PI * 2) {
        _longitude = Math.PI * 2 - _longitude;
    }

    var newPosition = [radius * Math.cos(_longitude) * Math.sin(_colatitude), radius * Math.sin(_longitude) * Math.sin(_colatitude), radius * Math.cos(_colatitude)];

    var diffPosition = [newPosition[0] - oldPosition[0], newPosition[1] - oldPosition[1], newPosition[2] - oldPosition[2]];

    rocketObj.translateX(diffPosition[0]);
    rocketObj.translateY(diffPosition[1]);
    rocketObj.translateZ(diffPosition[2]);

}

function setCartesianCoordinates(obj, radius, colatitude, longitude) { 
    'use strict';
    
    console.log("colatitude: " + colatitude + " !Longitude: " + longitude);
    console.log("X: " + radius * Math.cos(colatitude) * Math.sin(longitude) + " !Y: " + radius * Math.sin(colatitude) * Math.sin(longitude) + " !Z: " + radius * Math.cos(longitude));
    obj.position.set(radius * Math.cos(longitude) * Math.sin(colatitude), radius * Math.sin(longitude) * Math.sin(colatitude), radius * Math.cos(colatitude));
}

function createRocket() {
    'use strict';

    var totalHeight = planetRadius / 10;        
    var bodyHeight = 3 * (totalHeight / 5);
    var noseHeight = 3 * (totalHeight / 10);
    var thrusterHeight = totalHeight / 10;
    
    rocketObj = new THREE.Group();

    material = new THREE.MeshBasicMaterial({transparent: true, opacity: 0.0});
    geometry = new THREE.SphereGeometry(totalHeight, 32, 16);
    colisionSphere = new THREE.Mesh(geometry, material);
    
    material = new THREE.MeshBasicMaterial({color: '#f0f0f0'});
    geometry = new THREE.CylinderGeometry(1, 1 , bodyHeight, 15);
    rocketBody = new THREE.Mesh(geometry, material);
    
    material = new THREE.MeshBasicMaterial({color: '#a91b0d'});
    geometry = new THREE.CylinderGeometry(0, 1, noseHeight, 15);
    rocketNose = new THREE.Mesh(geometry, material);
    
    material = new THREE.MeshBasicMaterial({color: '#000fff'});
    geometry = new THREE.CylinderGeometry(0.4, 0.4, 0.3, 15);
    windowRocket = new THREE.Mesh(geometry, material);
        
    material = new THREE.MeshBasicMaterial({color: '#a91b0d'});
    geometry = new THREE.CapsuleGeometry(0.3, thrusterHeight, 4, 8);
    thrusters.push(new THREE.Mesh(geometry, material));
    thrusters.push(new THREE.Mesh(geometry, material));
    thrusters.push(new THREE.Mesh(geometry, material));
    thrusters.push(new THREE.Mesh(geometry, material));
    
    _colatitude = Math.random() * ((181 * Math.PI) / 180);
    _longitude = Math.random() * ((361 * Math.PI) / 180);

    setCartesianCoordinates(rocketObj, planetRadius * 1.2, _colatitude, _longitude);
    windowRocket.rotateX(Math.PI/2);
    windowRocket.position.set(0, 0.5, 0.9);
    rocketNose.position.set(0, bodyHeight / 2 + noseHeight / 2, 0);
    thrusters[0].position.set(1, -bodyHeight / 2, 0);
    thrusters[1].position.set(-1, -bodyHeight / 2, 0);
    thrusters[2].position.set(0, -bodyHeight / 2, 1);
    thrusters[3].position.set(0, -bodyHeight / 2, -1);
    
    rocketBody.add(thrusters[0]);
    rocketBody.add(thrusters[1]);
    rocketBody.add(thrusters[2]);
    rocketBody.add(thrusters[3]);
    rocketBody.add(rocketNose);
    rocketBody.add(windowRocket);
    colisionSphere.add(rocketBody);
    rocketObj.add(colisionSphere);
    scene.add(rocketObj);
}

function detectCollision() {
    'use strict';
    var quadrant;

    //rocket coordinates
    var x = rocketObj.position.x;
    var y = rocketObj.position.y;
    var z = rocketObj.position.z;

    //quadrant 1
    if (_colatitude < Math.PI / 2 && _longitude < Math.PI) {
        quadrant = quadrant1;
        console.log("1!");
    }
        
    //quadrant 2
    else if (_colatitude < Math.PI / 2 && _longitude >= Math.PI) {
        quadrant = quadrant2;
        console.log("2!");
    }
        
    //quadrant 3
    else if (_colatitude >= Math.PI / 2 && _longitude < Math.PI) {
        quadrant = quadrant3;
        console.log("3!");
    }
        
    //quadrant 4
    else if (_colatitude >= Math.PI / 2 && _longitude >= Math.PI) {
        quadrant = quadrant4;
        console.log("4!");
    }

    console.log("Rocket Position = (" + _colatitude + ", " + _longitude +  ")")
    console.log(quadrant);

    console.log("Quadrant 1: " + quadrant1);
    console.log("Quadrant 2: " + quadrant2);
    console.log("Quadrant 3: " + quadrant3);
    console.log("Quadrant 4: " + quadrant4);

    for (let i = 0; i < quadrant.length; i++) {
        var obj = quadrant[i];
        var distance = Math.sqrt(Math.pow(obj.position.x - x, 2) + Math.pow(obj.position.y - y, 2) + Math.pow(obj.position.z - z, 2));
        //console.log("Object Position = (" + obj.position.x + ", " + obj.position.y + ", " + obj.position.z + ")");
        if (distance <= planetRadius/22 + planetRadius/10) {
            toDelete.push(obj);    
        }
    }

    for (let i = 0; i < toDelete.length; i++) {
        var obj = toDelete[i];
        quadrant.pop(obj);
    }
}

function render() {
    'use strict';
    delta = clock.getDelta();

    //console.log(toDelete);

    for (let i = 0; i < toDelete.length; i++) {
        var obj = toDelete[i];
        scene.remove(obj);
    }

    toDelete = [];
    renderer.render(scene, camera);
}

function createOrtCamera() {
    'use strict';

	if (window.innerWidth / window.innerHeight > ratio) {
        camera1 = new THREE.OrthographicCamera(-window.innerWidth / scale_height, window.innerWidth / scale_height, window.innerHeight / scale_height, -window.innerHeight / scale_height, 1, 1000);
    }

    else {
        camera1 = new THREE.OrthographicCamera(-window.innerWidth / scale_width, window.innerWidth / scale_width, window.innerHeight / scale_width, -window.innerHeight / scale_width, 1, 1000);
    }

    last_width = window.innerWidth;
    last_height = window.innerHeight;

    camera1.position.set(0, 0, 70);
    camera1.lookAt(scene.position);
}

function createFixedPerspCamera() {
    'use strict';

	camera2 = new THREE.PerspectiveCamera(1000, window.innerWidth / window.innerHeight, 1, 1000);
	camera2.position.set(0, 0, 100);
	camera2.lookAt(scene.position);
    camera2.rotateZ(Math.PI);
}

function createRocketPerspCamera() {
    'use strict';

	camera3 = new THREE.PerspectiveCamera(100, window.innerWidth / window.innerHeight, 1, 100);
	camera3.position.set(3, 6, 0);
	camera3.lookAt(scene.position);
    rocketObj.add(camera3);
}

function createCameras() {
	'use strict';

    createOrtCamera();
    createFixedPerspCamera();
    createRocketPerspCamera();

    camera = camera1;
}

function createPlanet(x, y, z) {
	'use strict';
    var planet = new THREE.Object3D();

    var texture = new THREE.Texture();
	texture.image = image;
	image.onload = function() {
	    texture.needsUpdate = true;
	};
    
    geometry = new THREE.SphereGeometry(planetRadius, 64, 64);
    material = new THREE.MeshBasicMaterial({ map: texture});
    mesh = new THREE.Mesh(geometry, material);

    planet.add(mesh);
    planet.position.set(x, y, z);

    scene.add(planet);
}

function addToQuadrant(obj, colat, lon) {
    if (colat < Math.PI / 2 && lon < Math.PI)
        quadrant1.push(obj);

    else if (colat < Math.PI / 2 && lon >= Math.PI)
        quadrant2.push(obj);
    
    else if (colat >= Math.PI / 2 && lon < Math.PI)
        quadrant3.push(obj);
    
    else if (colat >= Math.PI / 2 && lon >= Math.PI)
        quadrant4.push(obj);
}

function createDodecahedron(r) {
    'use strict';
    var dode = new THREE.Object3D();

    geometry = new THREE.DodecahedronGeometry(r, 0);
    material = new THREE.MeshBasicMaterial({ color:  0xDDA0DD, wireframe: false });
    mesh = new THREE.Mesh(geometry, material);

    material = new THREE.MeshBasicMaterial({transparent: true, opacity: 0.0});
    geometry = new THREE.SphereGeometry(r, 32, 16);
    var sphere = new THREE.Mesh(geometry, material);

    dode.add(mesh);
    dode.add(sphere);

    var colat = Math.random() * ((181 * Math.PI) / 180);
    var lon = Math.random() * ((361 * Math.PI) / 180);
   	setCartesianCoordinates(dode, planetRadius * 1.2, colat, lon);
    addToQuadrant(dode, colat, lon);

    scene.add(dode);
}

