function createTrash() {
	for(let i=0; i < 0; i++){
		createDodecahedron(planetRadius/22);
	}

	for(let i=0; i < 0; i++){
		createPyramid(planetRadius/22, planetRadius/22);
	}

	for(let i=0; i < 0; i++){
		createCube(planetRadius/22);
	}

	for(let i=0; i < 1; i++){
		createOctahedron(planetRadius/22);
	}
}

function createScene() {
	'use strict';
    scene = new THREE.Scene();
    createPlanet(0, 0, 0);
    createRocket();
    createTrash();
}

function init() {
	'use strict';

    renderer = new THREE.WebGLRenderer({ alpha: true, antialias: true });

    renderer.setSize(window.innerWidth, window.innerHeight);

    scale_width = window.innerWidth * scale;
	scale_height = window.innerHeight * scale * ratio;
    
    document.body.appendChild(renderer.domElement);
    
    loadTexture();

    createScene();

    createCameras();

    window.addEventListener("resize", onResize);
    window.addEventListener("keydown", onKeyDown);
    window.addEventListener("keyup", onKeyUp);
}

function animate() {
    'use strict';

    movement = [0, 0];

    if (moveLatitudeNeg)
        movement[0] -= (Math.PI/180);
    
    if (moveLatitudePos)
        movement[0] += (Math.PI/180);
    
    if (moveLongitudeNeg)
        movement[1] -= (Math.PI/180);

    if (moveLongitudePos)
        movement[1] += (Math.PI/180);

    translateRocket(planetRadius * 1.2, movement[0], movement[1]);
    detectCollision();

    requestAnimationFrame(animate);
    render();
}

function onResize() {

}

function onKeyUp(e) {
    'use strict';

    switch (e.keyCode) {

        case 37: //left arrow
            moveLongitudeNeg = false;
            break;

        case 38: //up arrow
            moveLatitudePos = false;
            break;

        case 39: //right arrow
            moveLongitudePos = false;
            break;

        case 40: //down arrow
            moveLatitudeNeg = false
            break;
    }
}

function onKeyDown(e) {
    'use strict';

    switch (e.keyCode) {

        case 37: //left arrow
            moveLongitudeNeg = true;
            break;

        case 38: //up arrow
            moveLatitudePos = true;
            break;

        case 39: //right arrow
            moveLongitudePos = true;
            break;

        case 40: //down arrow
            moveLatitudeNeg = true;
            break;
        
        case 49: //1
            camera = camera1;
            break;

        case 50: //2
            camera = camera2;
            break;
        
        case 51: //3
            camera = camera3;
            break;
    }

}
function loadTexture() {
    image = new Image();
    image.src = 'data:image/jpeg;base64,';
}